import React from 'react';
import { useEffect, useState } from 'react';
// import { useState } from 'react';
import toast from 'react-hot-toast';
import Axios from '../axios-config';
import { useAuthUser, useIsAuthenticated } from 'react-auth-kit';
// import { ProfileElements } from '../components/ProfileElements';

type ProfileAttributes = {
  _id: string;
  username: string;
  // password: string;
  email: string;
  // icone: string;
}

export const Profile = (props: { match: { params: { id: string } } }) => {

  const getUser = useAuthUser();
  const [user, setUser] = useState({} as ProfileAttributes);
  // const [email, setEmail] = useState('');
  const isAuth = useIsAuthenticated();


  useEffect(() => {
    const fetchUsers = async (id: string) => {
      Axios.get('/users')
        .then(({ data }) => {
          console.log(data);
          setUser(data.content);
        })
        .catch((err) => {
          if (err.isAxiosError) {
            toast.error(
              `Could not load profile: ${err.response?.data.message}`,
            );
          } else {
            toast.error(`Could not load profile: ${err}`);
          }
        });
    };

    fetchUsers(props.match.params.id);
  }, [props.match.params.id, getUser]);

  return (
    <>
    <div className="test">
    <p>profile</p>
    {/*profile.map((profile, index) => (
      <ProfileElements profile={profile} key={'profile-${index}'} />
    ))*/}
    {isAuth() ? (
      <div className="m-auto">
      <i className="fas fa-sign-out-alt pr-2" />
      Sign out
      {getUser() ? (
        <div className="m-auto">
        <p>ok
        {user.username}</p>
        </div>
      ) : (
        <div className="m-auto">
        ko
        </div>
      )}
      </div>
    ) : (
      <div className="m-auto">
      Not connected
      {getUser() ? (
        <div className="m-auto">
        ok
        </div>
      ) : (
        <div className="m-auto">
        ko
        </div>
      )}
      </div>
    )}
    </div>
    </>
  );
};
